        content: ['Phim Quyết Chiến Lúc Bình Minh - Lê Minh Quyết Chiến lấy bối cảnh năm 1946, Trình Tường tiếp quản cục cảnh sát Cáp Nhĩ Tân Nguỵ Mãn, nhậm chức cục trưởng cục công an. Cáp Nhĩ Tân khi đó đang phải chịu sức ép về nhiều mặt: Quốc Dân Đảng đang chiếm giữ tại Trường Xuân có thể tiến vào tấn công Cáp Nhĩ Tân bất cứ lúc nào, tổ chức đặc vụ của địch ẩn thân trong bóng tối, thổ phỉ ác bá hoành hành, người nhật luôn rình thời cơ làm loạn. Trong nội bộ, các cán bộ công an đến từ nhiều nơi, suy nghĩ cũng như phương pháp làm việc đều khác nhau, dẫn đến bất hoà, chia rẽ. Công hội và nông hội cũng đang tranh luận xem ai sẽ là người lãnh đạo việc quản lý thành phố, trong khi tầng lớp lãnh đạo thành phố thiếu kinh nghiệm quản lý... Những vấn đề này khiến Trình Tường và các đồng sự chịu áp lực rất lớn. Các gián điệp và đặc vụ cấp cao do Quốc Dân Đảng phái đi đặc huấn tại Mỹ thâm nhập vào Cáp Nhĩ Tân. Trình Tường tập hợp toàn bộ lực lượng của cục công an, dựa vào cơ sở quần chúng, ngăn chặn các âm mưu của kẻ địch. Vì ổn định trị an xã hội mà thành lập uỷ ban hành chính, hoàn thiện phương thức quản lý người nước ngoài toàn thành phố, bãi bỏ kỹ viện, sòng bạc… thanh trừng nội gian ẩn thân trong cục công an, phá vụ án tướng quân Lý Triệu Lân bị hành thích. -- Giới thiệu nhân vật: + Trình Tường (Vương Thiên Nguyên) Một chiến sĩ cảnh sát công an nhân dân đầy chính nghĩa, tài trí, trầm ổn, thân thủ cao, đất nước được xây dựng chưa được bao lâu liền nhận nhiệm điều tra một vụ án bí mật. Trong quá trình điều tra, anh bất ngờ gặp gỡ Tống Hồng Lăng, 2 người trải qua một mối tình đầy đau khổ, sóng gió. + Tống Hồng Lăng (Lưu Thi Thi) Nữ đặc công xinh đẹp, lạnh lùng, thân phận bí ẩn, vì nhiệm vụ mà cùng với Dương Cảnh Tu giả làm vợ chồng. Trong 1 lần làm nhiệm vụ, cô tình cờ gặp Trình Tường, 2 người không đánh không quen nhau, từ đó cùng nhau trải qua mối tình ngược tâm đầy sóng gió. + Dương Cảnh Tu (Tào Bính Côn) Một đặc công ác độc đầy thủ đoạn, đem lòng yêu Tống Hồng Lăng, theo lệnh cấp trên mà cùng Tống Hồng Lăng giả làm vợ chồng, nội tâm u ám, ngoại trừ nhiệm vụ thì chỉ quan tâm đến Tống Hồng Lăng. + Kim Vũ Hiên (Trương Hy Lâm) Tuy thuộc phái đối địch với đặc công, nhưng luôn có nguyên tắc riêng của mình, nửa chính nửa tà, là nhân vật quan trọng đã khám phá ra việc Nhật Bản còn để loại quân hỏa khi lui quân, ngăn chặn sự bao vây truy đuổi của các thế lực, triển khai hàng loạt các trận quyết đấu sinh tử. + Tống Ngọc Hạm (Lý Mộng) Em gái của Tống Hồng Lăng, cũng là một đặc công thân thủ tốt, đơn thuần dễ thương, bất kỳ việc gì cũng không suy nghĩ quá nhiều, luôn nỗ lực vì lý tưởng, tín ngưỡng của bản thân. + Thang Văn Cảnh (Vương Tử Tề) Chuyên gia thông tin Trình Tường mời về, đảm nhận bảo mật truyền tin hồ sơ quản lý, là phần tử tri thức của thành phố nhỏ. Tính tình dịu dàng hiền thục, cởi mở, có tư chất tiểu thư khuê các. + Chu Nhã Lộ (Tạ tử Nhất) Đầu óc nhanh nhạy, là khoa khôi của Lầu Kim Ngọc, tuy là nữ tử phong trần, nhưng lại không cam chịu làm người ngoài cuộc. Trong một lần vô tình nhận được tin tình báo quan trọng, vì không hài long với hiện tại và mờ mắt vì lợi ích, cô trở thành một kẻ bán tin tình báo. Cuối cùng vì buôn bán tin tình báo, dọa dẫm chèn ép vơ vét tài sản mà đắc tội Cục điều tra thống kê của Quốc Dân Đảng, gây nguy hiểm đến tính mạng của Tống Hồng Lăng và nhiều người khác. + Triệu Lộc Vi (Nhậm Chính Bân) Một tên giảo hoạt, lọc lõi, nửa chính nửa tà, luôn giữ thế trung gian, không đắc tội với cả 2 bên, rất am hiểu đạo đối nhân xử thế, cách tự bảo vệ bản thân  '],
