        content: ['Phim Hành Tinh Xanh 2 Phần 1 của Blue Planet I được BBC phát sóng cách đây 16 năm với 10 tập phim, được xem là loạt phim về đại dương công phu và từng gây kinh ngạc ở thời điểm đó.   Chưa thỏa mãn và còn nhiều điều để khám phá, 16 năm sau nhóm làm phim tài liệu khoa học tự nhiên của BBC tiếp tục những chuyến hành trình thám hiểm các đại dương sâu thẳm và thế giới sinh vật kỳ lạ ở các vùng biển khác nhau.  Nhóm làm phim phải mất 4 năm thực hiện với 125 cuộc thám hiểm tại 39 quốc gia, quay hơn 6.000 giờ dưới độ sâu của các đại dương và đội ngũ quay phim phải thực hiện 4.000 cú lặn khác nhau, nhiều trong số đó ở những khu vực nguy hiểm ít người khám phá như Nam cực, Bắc cực...  Kỹ thuật lặn hiện đại nhất không tạo ra bong bóng hay tiếng ồn, cho phép đội quay có những cuộc gặp gỡ gần gũi và kéo dài hơn với các loài sinh vật dưới đáy biển.   Công nghệ phát triển và kỹ thuật quay phim hiện đại giúp những nhà quay phim quay được những cảnh chưa bao giờ thấy được trước đây.   Máy quay ánh sáng thấp bắt được những hình ảnh không thấy được bằng mắt trần. Ở nhiều độ sâu của các đại dương, nhà quay phim gần như hoàn toàn "mù" và quay trong bóng tối đen đặc.  Blue Planet II bluray 2017 gồm 7 tập do bác David Attenboroug dẫn chương trình: 1..........."One Ocean" 2............"The Deep" 3............"Coral Reefs" 4............"Big Blue" 5............"Green Seas" 6............"Coasts" 7............"Our Blue Planet" Tập 5 này có nhiều cảnh thú vị: con bạch tuột lấy vỏ sò quấn quanh mình tạo một khối như cái lu để đánh lừa cá mập pyjama, cảnh nhím biển tàn sát tảo bẹ hay cảnh cá ngựa ăn con mysid (một loài tép tí hon), cảnh tôm tích săn cá nhỏ... là những cảnh quay lạ chưa từng có trong bộ phim tài liệu nào. '],
